    render() {
        return(
            <>
                <div className="collapse" id={`collapse${this.props.id}`} style={{paddingTop:'10px'}}>
                    <div className="card card-body">
                        {this.props.answer}
                    </div>
                </div>
            </>
        );
    }
}
